onload = function () {
	// 描画コンテキストの取得
	canvas = document.getElementById("gamecanvas");
	g = canvas.getContext("2d");
	
	// シェアボタン無効化
	//btn_Share.disabled = true;
	
	// 初期化
	scene = "";
	darken = 0;

	// 入力処理の指定
	document.onkeydown = keydown;
	document.onmousedown = mousedown;

	// ゲームループの設定（FPS）
	setInterval("gameloop()", 16);
};
